			shellScript = "​\n# Sets the target folders and the final framework product.\n# 如果工程名称和Framework的Target名称不一样的话，要自定义FMKNAME\n# 例如: FMK_NAME = \"MyFramework\"\nFMK_NAME=${PROJECT_NAME}\n# Install dir will be the final output to the framework.\n# The following line create it in the root folder of the current project.\nPRODUCT_DIR=${SRCROOT}/../YSLib\nINSTALL_DIR=${SRCROOT}/../YSLib/BMKit/${FMK_NAME}.framework\n# Working dir will be deleted after the framework creation.\nWORK_DIR=build\nDEVICE_DIR=${WORK_DIR}/${CONFIGURATION}-iphoneos/${FMK_NAME}.framework\nSIMULATOR_DIR=${WORK_DIR}/${CONFIGURATION}-iphonesimulator/${FMK_NAME}.framework\n\n# -configuration ${CONFIGURATION} \"Release\"\n# Clean and Building both architectures.\n#xcodebuild -configuration \"Release\" -target \"${FMK_NAME}\" -sdk iphoneos clean build\n#xcodebuild -configuration \"Release\" -target \"${FMK_NAME}\" -sdk iphonesimulator clean build\nxcodebuild -configuration ${CONFIGURATION} -target \"${FMK_NAME}\" -sdk iphoneos\nxcodebuild -configuration ${CONFIGURATION} -target \"${FMK_NAME}\" -sdk iphonesimulator\n\n# Cleaning the oldest.\nif [ -d \"${INSTALL_DIR}\" ]\nthen\nrm -rf \"${INSTALL_DIR}\"\nfi\nmkdir -p \"${INSTALL_DIR}\"\n\ncp -R \"${DEVICE_DIR}/\" \"${INSTALL_DIR}/\"\n#cp -R \"${SIMULATOR_DIR}/\" \"${INSTALL_DIR}/\"\n\n# Uses the Lipo Tool to merge both binary files (i386 + armv6/armv7) into one Universal final product.\nlipo -create \"${DEVICE_DIR}/${FMK_NAME}\" \"${SIMULATOR_DIR}/${FMK_NAME}\" -output \"${INSTALL_DIR}/${FMK_NAME}\"\nrm -r \"${WORK_DIR}\"\nopen \"${PRODUCT_DIR}\"\n\n";
